import{P as s}from"./PageHeader-1844e30a.js";import{_ as t,a as i,b as a,c as l}from"./test-amico-160dba6c.js";import{_ as n,a as o,b as c,c as r,d as _}from"./color-icon-logo-11d027e7.js";import{_ as m,g as p,j as d,k as h,m as g,u}from"./index-00b50102.js";const f="/images/icons/screen-transition-diagram.svg",v="/images/icons/ui-design.svg",y="/images/icons/ux-design.svg",w="/images/icons/tool-used.svg",b="/images/icons/hearing-ability.svg",x="/images/icons/revision.svg",D={components:{PageHeader:s},name:"DigitalAssetsPage"},k=u('<main><section class="system-sec auto-container mt-5"><h2 class="system-sec__tiile">Front Design Design</h2><p class="system-sec__text"> IDENBRID places emphasis on the design development process as it is the primary point of contact for users when interacting with websites and applications, and can greatly impact the reputation of the application&#39;s design and usability. </p><ul class="system-sec__contents system-sec__contents_design"><li class="system-sec__list"><img src="'+f+'" alt="image" class="system-sec__list__thumbnail"><h3 class="system-sec__list__title">Screen Transition Diagram</h3><p class="system-sec__list__text"> To confirm the behavior of buttons and links that lead to the next page, a diagram, often referred to as a wireframe, is created to serve as a blueprint.</p></li><li class="system-sec__list"><img src="'+v+'" alt="image" class="system-sec__list__thumbnail"><h3 class="system-sec__list__title">UI Design</h3><p class="system-sec__list__text"> This pertains to the user interface, the visual component of a web system or application. We give consideration not only to the overall color scheme but also to the typography, hues, and even the photographic images. </p></li><li class="system-sec__list"><img src="'+y+'" alt="image" class="system-sec__list__thumbnail"><h3 class="system-sec__list__title">UX Design</h3><p class="system-sec__list__text"> Improving the user experience, also known as customer experience, is our primary focus. Design plays a critical role in enhancing usability, and we utilize a blend of trends and expertise to achieve it. </p></li></ul></section><section class="system-sec auto-container"><h2 class="system-sec__tiile">Why choose our design?</h2><p class="system-sec__text"> IDENBRID is often approached for design-only projects, owing to the fact that we have skilled designers who excel at creating comprehensive visualizations of UI/UX designs and graphics. </p><ul class="system-sec__contents system-sec__contents_last"><li class="system-sec__list"><img src="'+w+'" alt="image" class="system-sec__list__thumbnail"><h3 class="system-sec__list__title">Tools used</h3><p class="system-sec__list__text"> We primarily concentrate on designing and creating wireframes using Figma or Adobe XD. Our approach involves implementing the design, along with screen logic, to ensure that it matches the effectiveness of the prototype.</p></li><li class="system-sec__list"><img src="'+b+'" alt="image" class="system-sec__list__thumbnail"><h3 class="system-sec__list__title">listening comprehension</h3><p class="system-sec__list__text"> Design is a crucial process that helps to actualize the client&#39;s ideals and vision. In order to achieve this, we carefully listen to the client&#39;s preferences and design requirements and work towards creating a design that aligns with their needs and desires. </p></li><li class="system-sec__list"><img src="'+x+'" alt="image" class="system-sec__list__thumbnail"><h3 class="system-sec__list__title">Revision</h3><p class="system-sec__list__text"> We aim to limit the number of design meetings to three and prioritize providing an appropriate revision response that transforms the client&#39;s ideal into reality, based on their feedback and requests.</p></li></ul></section><section class="flow"><div class="auto-container"><h3 class="content-title content-title_flow">Flow in Web System Development</h3><p class="content-text content-subtitle_flow"> From the initial consultation to the final launch of your website or app, we provide comprehensive development services that cover all your needs. Our one-stop-shop approach ensures a seamless experience for our clients, eliminating the need to communicate with multiple parties and simplifying the development process.</p></div><div class="flow__scroll auto-container soft-development"><ul class="flow__contents"><li class="flow__list flow__list_border"><img src="'+t+'" alt="image" class="flow__list__thumbnail"><h4 class="flow__list__title">Upon inquiry, we schedule a consultation to review project requirements and relevant documents, then provide a detailed estimate for the scope of work and costs.</h4><p class="flow__list__text"> Once we receive an inquiry, we will evaluate the Request for Proposal (RFP) and the project requirements to create an estimate. We will also hold a meeting to discuss the project and its budget.</p></li><li class="flow__list flow__list_border"><img src="'+i+'" alt="image" class="flow__list__thumbnail"><h4 class="flow__list__title">Requirement definition and basic design</h4><p class="flow__list__text">We establish specifications and outline the development process according to our standard format while also managing the project schedule. </p></li><li class="flow__list flow__list_border"><img src="'+a+'" alt="image" class="flow__list__thumbnail"><h4 class="flow__list__title">UIUX design and development</h4><p class="flow__list__text"> Based on detailed design documents, we create designs from screen transition diagrams and proceed with the development of the system, application, and infrastructure.</p></li><li class="flow__list"><img src="'+l+'" alt="image" class="flow__list__thumbnail"><h4 class="flow__list__title">Testing and delivery</h4><p class="flow__list__text">After testing the application based on predetermined cases, we confirm the results with the customer before proceeding with application review and deployment to the server. </p></li></ul></div></section><section class="exp-menu-list"><div class="menu-box"><div class="item"><span class="text"><img src="'+n+'" alt="image">Web System Development </span></div><div class="item"><span aria-current="page" class="text router-link-exact-active router-link-active router-link-exact-active router-link-active"><img src="'+o+'" alt="image">Smartphone application development </span></div><div class="item"><span class="text"><img src="'+c+'" alt="image">UIUX design production </span></div><div class="item"><span class="text"><img src="'+r+'" alt="image">offshore development</span></div><div class="item"><span class="text"><img src="'+_+'" alt="image">SES Engineer Style </span></div></div></section></main>',1);function U(I,S,q,W,j,E){const e=p("pageHeader");return d(),h("div",null,[g(e,{title:"UI/Ux DESIGN"}),k])}const P=m(D,[["render",U]]);export{P as default};
